import{_ as M,c as D,o as A,a as w}from"./app.5caad1d2.js";const G=JSON.parse('{"title":"Finite-State Machines","description":"","frontmatter":{},"headers":[{"level":2,"title":"Methodology: design the circuit, then write the code.","slug":"methodology-design-the-circuit-then-write-the-code","link":"#methodology-design-the-circuit-then-write-the-code","children":[]},{"level":2,"title":"Schematic","slug":"schematic","link":"#schematic","children":[]},{"level":2,"title":"Suggested Study Order","slug":"suggested-study-order","link":"#suggested-study-order","children":[]}],"relativePath":"fsm/README.md"}'),N={name:"fsm/README.md"},g=w(`<h1 id="finite-state-machines" tabindex="-1">Finite-State Machines <a class="header-anchor" href="#finite-state-machines" aria-hidden="true">#</a></h1><p>This directory provides a tutorial on how to create finite state machines (FSMs) in VHDL. The example demonstrates two different models, which I refer to as the 1-process and 2-process models. The 1-process model uses the coding guidelines from sequential logic to capture the state register, next-state logic, and output logic in a single process. However, this model has the limitation of registering the outputs, which I don&#39;t recommend unless you have a good reason to do so. The 2-process model uses one process for sequential logic (the state register) and another process for combinational logic (next-state and output logic). I strongly recommend the 2-process model to avoid the extra cycle of delay on the output of the 1-process model.</p><p>You might see other people using 3- and 4-process models, but I&#39;ve never seen an advantage. <a href="http://www.sunburst-design.com/papers/CummingsSNUG2019SV_FSM1.pdf" target="_blank" rel="noreferrer">This paper</a> is an excellent paper on different FSM coding styles. It reports advantages of their 3- and 4- process models, but I can represent everything in those models using 2 processes, so to my knowledge there is no inherent technical advantage, possibly just a convenience advantage. In any case, I will explore the issue further and update the examples for any new findings.</p><h2 id="methodology-design-the-circuit-then-write-the-code" tabindex="-1">Methodology: design the circuit, then write the code. <a class="header-anchor" href="#methodology-design-the-circuit-then-write-the-code" aria-hidden="true">#</a></h2><p>For FSMs, designing the circuit is a little more obvious, and corresponds to creating the states, transitions between states, and outputs for each state and/or transition. Basically, you want create a diagram for the FSM. Given that diagram, it is trivial to convert the FSM into code, as shown in the examples below.</p><h2 id="schematic" tabindex="-1">Schematic <a class="header-anchor" href="#schematic" aria-hidden="true">#</a></h2><iframe src="data:application/pdf;base64,#toolbar=0&amp;navpanes=0" style="width:100%;border:none;rule:none;min-height:30rem;">
</iframe><blockquote><p>Alternative link: <a href="data:application/pdf;base64," download="fsm.pdf">fsm.pdf</a></p></blockquote><h2 id="suggested-study-order" tabindex="-1">Suggested Study Order <a class="header-anchor" href="#suggested-study-order" aria-hidden="true">#</a></h2><ol><li><a href="./moore.html">Moore</a></li><li><a href="./mealy.html">Mealy</a></li></ol>`,10),I=[g];function U(j,T,z,Y,C,Q){return A(),D("div",null,I)}const m=M(N,[["render",U]]);export{G as __pageData,m as default};
